import React, { Component } from 'react';
import './Home.sass';
import { Grid, Paper } from '@material-ui/core';

const styles = ({
    root: {
        flexGrow: 1,
    },
    paper: {
        textAlign: 'center',
    },
});
class Home extends Component {

    render() {
        return (
            <div className={'Home-container'}>
                <Grid container spacing={24}>
                    <Grid item xs={12}>
                        <Paper styles={styles.paper}>
awsdasd
                        </Paper>
                    </Grid>
                </Grid>
            </div>
        );
    }
}
export default Home;
